void mainImage( out vec4 O, in vec2 f )
{
    vec2 uv = f / iResolution.y,
        u = vec2(fract(uv.x * 3. - iTime * .2), uv.y * 1.6 - .3);
    if(u.y > .5){
        u.x = abs(u.x - .5);
    }
    float k = length(u - .5),
        e = smoothstep(k, k * .99, .5);
    vec3 a = vec3(1.,0.,0.),
        b = u.y > .5 ? vec3(1.) : vec3(0.,0.,.2);
    O = vec4(mix(a,b,e),1.);
}
